import Card from "./components/card";
import { trekData } from "./trekInfo";

function App() {
  return (
    <div>
      <ul className="flex flex-row gap-2 overflow-y-auto">
        {
          trekData.map((item) => <Card key={item.id} data={item} />)
        }
      </ul>
    </div>
  );
}

export default App;
